import React from 'react';
import styled from "styled-components";
import PropTypes from 'prop-types';
import { Card, Button } from "./index";

const PanelItem = styled.div`
  background: #DFE3E6;
  border-radius: 3px;
  padding: 12px;
  width: 272px;
`

const Panel = ({ items }) => {
    return (
        <PanelItem>
            {items.map(card => (
                <Card {...card} />
            ))}
        </PanelItem>
    );
};

export default Panel;
